function setDpi(dpi){

	savedDpi1 = dpi;

	let RoundedDpi = Math.round(dpi/100)*100;
	var packet = [];
	packet[0] = 0x00;
	packet[1] = 0x08;
	packet[2] = 0x01;
	packet[3] = 0x20;
	packet[4] = 0x00;
	packet[5] = RoundedDpi%256;
	packet[6] = Math.floor(RoundedDpi/256);
	device.write(packet, 65);
	device.read(packet, 65);
	//device.pause(1)

	var packet = [];
	packet[0] = 0x00;
	packet[1] = 0x08;
	packet[2] = 0x01;
	packet[3] = 0x22;
	packet[4] = 0x00;
	packet[5] = RoundedDpi%256;
	packet[6] = Math.floor(RoundedDpi/256);
	device.write(packet, 65);
	device.read(packet, 65);
}


