export function Initialize() {
	EnableSoftwareControl();


	if(savedDpi1 != dpi1 && DpiControl){
		setDpi(dpi1);
	}
}


export function Render() {
	sendColors();

	if(savedDpi1 != dpi1 && DpiControl){
		setDpi(dpi1);
	}
}

function sendColors(shutdown = false){
	//00000000  08 06 00 0F 00 00 00 FF FF 00 FF 00 29 29 00 FF 00 24 24 00 FF 00 00
	let RGBData = new Array(20).fill(0);
	let packet = [];
	packet[0x00]   = 0x00;
	packet[0x01]   = 0x08;
	packet[0x02]   = 0x06;
	packet[0x03]   = 0x00;
	packet[0x04]   = 0x0F;
	packet[0x05]   = 0x00;
	packet[0x06]   = 0x00;
	packet[0x07]   = 0x00;

	// Single zone - apply to mouse.
	for(let zone_idx = 0; zone_idx < vLedPositions.length; zone_idx++) {
		let iX = vLedPositions[zone_idx][0];
		let iY = vLedPositions[zone_idx][1];
		var col;

		if(shutdown){
			col = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			col = hexToRgb(forcedColor);
		}else{
			col = device.color(iX, iY);
		}

		RGBData[zone_idx] = col[0];
		RGBData[zone_idx+5] = col[1];
		RGBData[zone_idx+10] = col[2];
	}

	packet = packet.concat(RGBData);
	device.write(packet, 65);
	device.read(packet, 65);
}

